import React, { Component } from 'react';
import "./home.css";
import myFace from './myFace.png';

export default class Home extends Component {
    render() {
      return (
          <div id="content">
            <img src={myFace} alt="My face" width="369" height="430"></img>
            <div className="name-and-jobtitle">
                <h1>Marcus Thorn Mathiesen</h1>
             </div>  
          </div>
      );
    }
}
